import Shell from "./Shell";
import store from "../../store";
function Policies() {
  const policies = store.getState().policies;
  return (
    <Shell
      heading="Policies"
      index={4}
      content={
        policies.length !== 0 ? (
          policies.map((policy) => <p key={Math.random()}>{policy}</p>)
        ) : (
          <p>No policies applicable. Sorry!</p>
        )
      }
    />
  );
}

export default Policies;
